import { AppBar, Typography, IconButton, Toolbar, Button ,Box} from '@mui/material';
import React from 'react'
import MenuOutlinedIcon from '@mui/icons-material/MenuOutlined';

export default function Sidebar() {
  return (

    

<AppBar position='static'>
        <Toolbar>
           
        <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuOutlinedIcon />
          </IconButton>

        </Toolbar>
      </AppBar>




   
  );
}
